import React from "react";
import styles from "./Home.module.css";

const Home: React.FC = () => {
  return (
    <div className={styles.container}>
      <header className={styles.header}>
        <h1 className={styles.title}>Welcome to Stinger Delay</h1>
        <p className={styles.subtitle}>
          Visualize transit delays and plan your trip efficiently.
        </p>
      </header>

      <section className={styles.content}>
        {/* TODO: insert components here */}
        <div className={styles.placeholder}>This is the home page content.</div>
      </section>

      <footer className={styles.footer}>
        &copy; {new Date().getFullYear()} Stinger Delay
      </footer>
    </div>
  );
};

export default Home;
